const instrument = [
    {
        name: 'mando',
        price: '150'
    },
    {
        name: 'violen',
        price: '155'
    }
];

localStorage.setItem('list', JSON.stringify(instrument))

class App extends Component{
    constructor(props){
        super(props)

        this.state = {
            instruments: []
        }
    }
    componentWillMount(){
       const instrments =  JSON.parse(localStorage.getItem('instrument'))

       console.log(instrments);

       this.setState({ instrument});
    } 

   render(){
       return (
           <div className="App">
               <h1>Instrument List</h1>
           </div>
       )
   }
}

export default App;
